import React from 'react';
import './Profile.css';
import Pfpic from './data/Anipic.png';

const Profile = () => {
	return(
		<div>
			<div>
				<img className='pf_pic' src={Pfpic} style="width: 50%; height: 50%"/>
			</div>
		</div>
	);
}

export default Profile;
